import React from 'react';

const Dashboard = () => (
  <div>
    <h1>Vulneramind Dashboard</h1>
    <p>Welcome to the AI-powered network vulnerability analysis system.</p>
    <ul>
      <li>Target Management</li>
      <li>Scan Initiation</li>
      <li>Scan Results</li>
      <li>Exploit Management</li>
      <li>Payload Wizard</li>
      <li>Reporting</li>
    </ul>
  </div>
);

export default Dashboard;
